import React from "react";
const Divide = ({ color }) => {
  console.log(color);
  return (
    <div
      style={{
        width: "350px",
        height: "350px",
        backgroundColor: { color },
        border: `10px solid ${color}`,
      }}
    ></div>
  );
};
export default Divide;
